    [],nt"revision_timestamp": "2016-03-28T18:43:18.105652",nt"name": "akro-standard-prices",nt"isopen":
    false,nt"url": null,nt"notes": "Standard prices are generated for cost
    recovery programs in the Individual Fishing Quota (IFQ) halibut and sablefish, BSAI
    Rationalized crab, and Central Gulf of Alaska Rockfish Program fisheries and for
    the North Pacific Groundfish and Halibut Fisheries Observer Program.  Standard prices
    will be generated for American Fisheries Act (AFA) pollock, Aleutian Islands pollock,
    Amendment 80, and Community Development Quota (CDQ) fisheries beginning in 2016.
     Standard prices are determined from industry reported volume and value reports
    or the State of Alaska Commercial Fisheries Entry Commission (CFEC) Gross Earnings
    data which are based on the Alaska Department of Fish and Game fish tickets and
    Commercial Operator's Annual Reports (COAR).",nt"license_title": null,nt"extras":
